/**********************************************************************/
/* Function , MQError                                                 */
/* Purpose  : Print out MQI function and reason code                  */
/**********************************************************************/
void MQError(char * Api,char * Obj, int  reason)
{
  char  o[50];

  memcpy(o,Obj,48);
  o[48]=0;

  Strip(o,48);
  fprintf(stderr,"%s on object '%s' returned %d %s.\n",
          Api,o,reason,MQReason(reason));
}

/**********************************************************************/
/* Function : MQReason                                                */
/* Purpose  : Return pointer to text equivalent of reason code if     */
/*            known.                                                  */
/**********************************************************************/
char * MQReason(int  reason)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQRC)/sizeof(MQVALUE)-1; i++)
  {
    if (ValMQRC[i].Const == reason) return ValMQRC[i].Desc;
  }
                                       /* Check feedback codes        */
  for (i=0 ; i< sizeof(ValMQFB)/sizeof(MQVALUE)-1; i++)
  {
    if (ValMQFB[i].Const == reason) return ValMQFB[i].Desc;
  }
  return "";
}

/**********************************************************************/
/* Function : MQCommand                                               */
/* Purpose  : Return pointer to text equivalent of command code       */
/**********************************************************************/
char * MQCommand(int  command)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQCMD)/sizeof(MQVALUE)-1; i++)
  {
    if (ValMQCMD[i].Const == command) return ValMQCMD[i].Desc;
  }
  return "";
}

/**********************************************************************/
/* Function : MQCommandConst                                          */
/* Purpose  : Return pointer to command constant                      */
/**********************************************************************/
char * MQCommandConst(int  command)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQCMD)/sizeof(MQVALUE)-1; i++)
  {
    if (ValMQCMD[i].Const == command) return ValMQCMD[i].Name;
  }
  return "";
}

/**********************************************************************/
/* Function : MQCommandStr                                            */
/* Purpose  : Return commmand code given the command name             */
/**********************************************************************/
int  MQCommandStr(char * command)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQCMD)/sizeof(MQVALUE)-1; i++)
  {
    if (!stricmp(ValMQCMD[i].Name,command)) return ValMQCMD[i].Const;
  }
  return -1;
}

