/**********************************************************************/
/* Function : FindValue                                               */
/* Purpose  : Return the value (if any)                               */
/**********************************************************************/
char * FindValue(int  value, MQVALUE * pValue,int Desc)
{
  while (pValue->Name)
  {
    if (pValue->Const == value)
    {
      if (Desc && pValue->Desc) return pValue->Desc;
                           else return pValue->Name;
    }
    pValue++;
  }
  return NULL;
}
/**********************************************************************/
/* Function : MQParameterValue                                        */
/* Purpose  : Return the associated with the given parameter/value    */
/**********************************************************************/
char * MQParameterValue(int  parameter,
                        int  value)
{
  switch(parameter)
  {
    case MQIA_APPL_TYPE:
    case MQIACF_EVENT_APPL_TYPE:
         return FindValue(value           ,ApplType,0)       ;
         break;

    case MQIACF_REASON_QUALIFIER:
         return FindValue(value           ,ReasonQualifier,0);
         break;

    case MQIACF_REASON_CODE:
    case MQIACF_CONV_REASON_CODE:
         return FindValue(value           ,ValMQRC,0);
         break;

    case MQIACF_COMMAND:
         return FindValue(value           ,ValMQCMD,0);
         break;

    case MQIACF_ERROR_IDENTIFIER:
         return FindValue(value&0x00FFFFFF,ValMQRC,0);
         break;

    case MQIA_Q_TYPE:
         return FindValue(value           ,QueueType,0)      ;
         break;

    case MQIACH_CHANNEL_TYPE:
         return FindValue(value           ,ChannelType,0)    ;
         break;

    default:
         break;
  }
  return NULL;
}
