{
  int  i;
  for (i=0 ; i< sizeof(ValMQPARM)/sizeof(MQVALUE)-1; i++)
  {
    if (!stricmp(ValMQPARM[i].Name,parameter)) return ValMQPARM[i].Const;
  }
  return -1;
}
