/* Function : MQConst                                                 */
/* Purpose  : Return pointer to text equivalent of MQ constant        */
/**********************************************************************/
char * MQConst(int  parameter)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQCONST)/sizeof(MQVALUE)-1; i++)
  {
    if (ValMQCONST[i].Const == parameter && ValMQCONST[i].Desc)
      return ValMQCONST[i].Desc;
  }
  return "";
}
/**********************************************************************/
/* Function : MQConstStr                                              */
/* Purpose  : Return MQSeries constant given the constant name        */
/**********************************************************************/
int    MQConstStr       (char   * name,
                         MQLONG * Const)
{
  int  i;
  for (i=0 ; i< sizeof(ValMQCONST)/sizeof(MQVALUE)-1; i++)
  {
    if (!stricmp(ValMQCONST[i].Name,name))
    {
      * Const = ValMQCONST[i].Const;
      return 1;
    }
  }
  return 0;
}


